class Solution_lc820
{

    /**
     * @param String[] $words
     * @return Integer
     */
    function minimumLengthEncoding($words)
    {
        if (empty($words)) return 0;

        $tmp = [];
        $map = array_unique($words);
        $words = $map;
        foreach ($words as $key => $val) {
            for ($i = 1; $i < strlen($val); $i++) {
//                $map = array_diff($map, [substr($val, $i)]);
                $tmp[] = substr($val, $i);
            }
            foreach ($map as $k => $value) {
                if (in_array($value, $tmp)) {
                    unset($map[$k]);
                }
            }
            $tmp = [];
        }
        $res = 0;
        foreach ($map as $val) {
            $res += strlen($val) + 1;
        }
        return $res;
    }

    /**
     * 想要用来检验一个字符串是不是另一个的后缀，但是没有用到，用这个遍历的时候，时间复杂度太大了
     * @param $a
     * @param $b
     * @return bool
     */
    function check($a, $b)
    {
        $aLen = strlen($a);
        $bLen = strlen($b);
        if ($aLen > $bLen) {
            return false;
        }
        for ($i = $aLen - 1, $j = $bLen - 1; $i >= 0 && $j >= 0; $i--, $j--) {
            if ($a[$i] != $b[$j]) {
                return false;
            }
        }
        return true;
    }
}

